車種専用オーダーカーフィルム<br><br><br>●車に合わせてカットされたフィルムです。<br>●面倒な型取りが不要でキレイに貼付け可能。<br>●厚手フィルムを使用しているので、シワになりにくく水抜きや空気抜きも簡単。<br>●傷に強いハードコートフィルム。UVカットやプライバシー保護に。<br><br><br>【仕様】<br>車種：ミツビシ リベロカーゴ CB/CD系 平成4年5月～平成12年3月<br>フィルムの種類：ハードコートフィルム（スーパーブラック）<br>可視光線透過率：5％±<br><br>メーカー：ミラリード/MIRAREED<br>品番：B050651<style type="text/css">
